import React from 'react';

const Skills = () => {
  const skills = ['Java', 'Python', 'React', 'Firebase', 'Tailwind CSS', 'UI/UX Design', 'Machine Learning', 'Git'];

  return (
    <section id="skills" className="text-white py-16 px-8">
      <div className="max-w-5xl mx-auto text-center">
        <h2 className="text-4xl font-bold text-primary mb-8">Skills</h2>
        <div className="flex flex-wrap justify-center gap-4">
          {skills.map(skill => (
            <span key={skill} className="bg-gray-800 px-4 py-2 rounded-full text-sm">{skill}</span>
          ))}
        </div>
      </div>
    </section>
  );
};

export default Skills;
